import React from 'react'
import "./ExpanseItem.css";

function ExpanseItem() {
    return (
        <div className='expanse-item'>
            <div className='expanse-item__date'>date</div>
            <div className='expanse-item__description'>
                <h1>title</h1>
            </div>
            <div className='expanse-item__price'>price</div>
        </div>
    )
}

export default ExpanseItem;
